            const double var_means[16] = {223.657985515, 1.85368193698, 0.981863333233, 117.802789022, 2.24000465475, 151.062317703, 77.2905091839, 153.488585894, 662.002905217, 3.04746695079, 1.62349414392, 114.163197672, 1.73250920217, 333.446821533, 0.118446310783, 0.101580334309};
